import{_ as a,c as s,o as n,a as e}from"./app.a5d2354c.js";const m=JSON.parse('{"title":"Instalasi","description":"","frontmatter":{},"headers":[{"level":2,"title":"Instalasi Dart SDK","slug":"instalasi-dart-sdk","link":"#instalasi-dart-sdk","children":[{"level":3,"title":"1. Instalasi pada Windows","slug":"_1-instalasi-pada-windows","link":"#_1-instalasi-pada-windows","children":[]},{"level":3,"title":"2. Instalasi pada Linux","slug":"_2-instalasi-pada-linux","link":"#_2-instalasi-pada-linux","children":[]},{"level":3,"title":"3. Instalasi pada MacOS","slug":"_3-instalasi-pada-macos","link":"#_3-instalasi-pada-macos","children":[]}]},{"level":2,"title":"Testing Instalasi","slug":"testing-instalasi","link":"#testing-instalasi","children":[]}],"relativePath":"getting-started/instalasi/index.md"}'),l={name:"getting-started/instalasi/index.md"},t=e(`<h1 id="instalasi" tabindex="-1">Instalasi <a class="header-anchor" href="#instalasi" aria-hidden="true">#</a></h1><p>Dart mendukung developer untuk membuat aplikasi web, mobile, desktop, dan server. Untuk memulai, Anda perlu menginstal Dart SDK dan mengatur lingkungan kerja Anda.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Dart otomatis terinstall pada flutter</p></div><h2 id="instalasi-dart-sdk" tabindex="-1">Instalasi Dart SDK <a class="header-anchor" href="#instalasi-dart-sdk" aria-hidden="true">#</a></h2><p>Baca dokumentasi resmi <a href="https://dart.dev/get-dart" target="_blank" rel="noreferrer">Dart SDK</a> untuk menginstal Dart SDK.</p><h3 id="_1-instalasi-pada-windows" tabindex="-1">1. Instalasi pada Windows <a class="header-anchor" href="#_1-instalasi-pada-windows" aria-hidden="true">#</a></h3><p>Dart dapat diinstall menggunakan tools <a href="https://chocolatey.org/" target="_blank" rel="noreferrer">Chocolately</a></p><ol><li>Buka terminal sebagai administrator</li><li>Untuk menginstall dart jalankan perintah dibawah</li></ol><div class="language-cmd"><button class="copy"></button><span class="lang">cmd</span><pre><code><span class="line"><span style="color:#A6ACCD;">choco install dart</span><span style="color:#89DDFF;">-</span><span style="color:#A6ACCD;">sdk</span></span>
<span class="line"></span></code></pre></div><ol><li>Setelah itu tambahkan dart kedalam environment variable <ol><li>buka menu pencarian dan ketik <code>env</code></li><li>tekan <code>Edit the system environment variables.</code></li><li>tekan <code>Environment Variables...</code></li><li>pada bagian <code>User Variables</code> pilih <code>Path</code> dan tekan <code>Edit...</code></li><li>Tekan <code>new</code> lalu tambahkan path ke posisi dart sdk <ul><li>contoh <code>C:\\ProgramData\\chocolatey\\lib\\dart-sdk\\tools\\dart-sdk\\bin</code></li></ul></li></ol></li></ol><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Jika anda tidak dapat menginstall menggunakan Chocolately, anda juga bisa langsung <em>mendownload</em> Dart SDK sebagai file <em>zip</em> disini <a href="https://dart.dev/get-dart/archive" target="_blank" rel="noreferrer">Dart SDK ZIP</a>, lalu tambahkan environment variable seperti yang dilakukan diatas.</p></div><h3 id="_2-instalasi-pada-linux" tabindex="-1">2. Instalasi pada Linux <a class="header-anchor" href="#_2-instalasi-pada-linux" aria-hidden="true">#</a></h3><div class="language-bash"><button class="copy"></button><span class="lang">bash</span><pre><code><span class="line"><span style="color:#A6ACCD;">$ sudo apt-get update</span></span>
<span class="line"></span>
<span class="line"><span style="color:#A6ACCD;">$ sudo apt-get install apt-transport-https</span></span>
<span class="line"></span>
<span class="line"><span style="color:#A6ACCD;">$ wget -qO- https://dl-ssl.google.com/linux/linux_signing_key.pub </span><span style="color:#89DDFF;">|</span><span style="color:#A6ACCD;"> sudo gpg --dearmor -o /usr/share/keyrings/dart.gpg</span></span>
<span class="line"></span>
<span class="line"><span style="color:#A6ACCD;">$ </span><span style="color:#82AAFF;">echo</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">deb [signed-by=/usr/share/keyrings/dart.gpg arch=amd64] https://storage.googleapis.com/download.dartlang.org/linux/debian stable main</span><span style="color:#89DDFF;">&#39;</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">|</span><span style="color:#A6ACCD;"> sudo tee /etc/apt/sources.list.d/dart_stable.list</span></span>
<span class="line"></span></code></pre></div><p>lalu install Dart SDK</p><div class="language-bash"><button class="copy"></button><span class="lang">bash</span><pre><code><span class="line"><span style="color:#A6ACCD;">$ sudo apt-get update</span></span>
<span class="line"></span>
<span class="line"><span style="color:#A6ACCD;">$ sudo apt-get install dart</span></span>
<span class="line"></span></code></pre></div><p>setelah Dart berhasil terinstall, saatnya mengatur environment variable</p><p><em>Sesuaikan dengan path</em></p><div class="language-bash"><button class="copy"></button><span class="lang">bash</span><pre><code><span class="line"><span style="color:#A6ACCD;">$ </span><span style="color:#C792EA;">export</span><span style="color:#A6ACCD;"> PATH=</span><span style="color:#89DDFF;">&quot;$</span><span style="color:#A6ACCD;">PATH</span><span style="color:#C3E88D;">:/usr/lib/dart/bin</span><span style="color:#89DDFF;">&quot;</span></span>
<span class="line"></span></code></pre></div><h3 id="_3-instalasi-pada-macos" tabindex="-1">3. Instalasi pada MacOS <a class="header-anchor" href="#_3-instalasi-pada-macos" aria-hidden="true">#</a></h3><p><strong><em>Coming soon....</em></strong></p><h2 id="testing-instalasi" tabindex="-1">Testing Instalasi <a class="header-anchor" href="#testing-instalasi" aria-hidden="true">#</a></h2><p>Untuk memastikan Dart berhasil terinstall, buka terminal dan ketikkan perintah dibawah</p><div class="language-bash"><button class="copy"></button><span class="lang">bash</span><pre><code><span class="line"><span style="color:#A6ACCD;">dart</span></span>
<span class="line"></span></code></pre></div><p>jika berhasil, tidak akan keluar error <code>dart command not found</code></p>`,24),i=[t];function o(r,p,d,c,u,h){return n(),s("div",null,i)}const k=a(l,[["render",o]]);export{m as __pageData,k as default};
